import React, { useState, useEffect } from 'react';
import { Search, Package, DollarSign, Image, AlertCircle, Loader2 } from 'lucide-react';
import samplePartsData from '../data/samplePartsData.json';
import sampleDiagramData from '../data/sampleDiagramData.json';

const PartsSearch = () => {
    const [searchTerm, setSearchTerm] = useState('');
    const [parts, setParts] = useState([]);
    const [filteredParts, setFilteredParts] = useState([]);
    const [loading, setLoading] = useState(true);
    const [selectedDiagram, setSelectedDiagram] = useState(null);
    const [selectedModel, setSelectedModel] = useState(null);

    useEffect(() => {
        // Load sample parts data
        setTimeout(() => {
            setParts(samplePartsData);
            setFilteredParts(samplePartsData);
            setLoading(false);
        }, 500);
    }, []);

    useEffect(() => {
        // Filter parts based on search term
        if (!searchTerm.trim()) {
            setFilteredParts(parts);
        } else {
            const searchLower = searchTerm.toLowerCase();
            const filtered = parts.filter(part =>
                part.partNumber.toLowerCase().includes(searchLower) ||
                part.description.toLowerCase().includes(searchLower) ||
                part.modelNumber.toLowerCase().includes(searchLower) ||
                part.sectionName.toLowerCase().includes(searchLower)
            );
            setFilteredParts(filtered);
        }
    }, [searchTerm, parts]);

    const handleDiagramClick = (modelNumber, diagramId) => {
        const diagrams = sampleDiagramData[modelNumber];
        const diagram = diagrams?.find(d => d.diagramId === diagramId);
        if (diagram) {
            setSelectedDiagram(diagram);
            setSelectedModel(modelNumber);
        }
    };

    const getStockStatus = (stock) => {
        if (!stock || typeof stock !== 'object') return { text: 'Unknown', color: 'text-gray-500' };

        const totalStock = Object.values(stock).reduce((sum, qty) => sum + parseInt(qty || 0), 0);

        if (totalStock > 10) return { text: 'In Stock', color: 'text-green-600' };
        if (totalStock > 0) return { text: `Low Stock (${totalStock})`, color: 'text-yellow-600' };
        return { text: 'Out of Stock', color: 'text-red-600' };
    };

    if (loading) {
        return (
            <div className="flex items-center justify-center h-64">
                <Loader2 className="w-8 h-8 animate-spin text-blue-600" />
            </div>
        );
    }

    return (
        <div className="space-y-6">
            {/* Search Bar */}
            <div className="relative">
                <Search className="absolute left-3 top-1/2 transform -translate-y-1/2 text-gray-400 w-5 h-5" />
                <input
                    type="text"
                    placeholder="Search by part number, description, or model..."
                    className="w-full pl-10 pr-4 py-3 border border-gray-300 rounded-lg focus:ring-2 focus:ring-blue-500 focus:border-transparent"
                    value={searchTerm}
                    onChange={(e) => setSearchTerm(e.target.value)}
                />
            </div>

            {/* Results Count */}
            <div className="text-sm text-gray-600">
                Found {filteredParts.length} parts
            </div>

            {/* Parts Grid */}
            <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
                {filteredParts.map((part, index) => {
                    const stockStatus = getStockStatus(part.stock);

                    return (
                        <div key={`${part.partNumber}-${index}`} className="bg-white rounded-lg shadow-md hover:shadow-lg transition-shadow">
                            {/* Part Image or Placeholder */}
                            <div className="relative h-48 bg-gray-100 rounded-t-lg overflow-hidden">
                                {part.imageUrl ? (
                                    <img
                                        src={part.imageUrl}
                                        alt={part.description}
                                        className="w-full h-full object-contain"
                                        onError={(e) => {
                                            e.target.onerror = null;
                                            e.target.src = 'data:image/svg+xml;base64,';
                                        }}
                                    />
                                ) : (
                                    <div className="w-full h-full flex items-center justify-center">
                                        <Package className="w-16 h-16 text-gray-400" />
                                    </div>
                                )}

                                {/* Diagram Button */}
                                <button
                                    onClick={() => handleDiagramClick(part.modelNumber, part.diagramId)}
                                    className="absolute top-2 right-2 bg-white bg-opacity-90 p-2 rounded-lg shadow-md hover:bg-opacity-100 transition-all"
                                    title="View Diagram"
                                >
                                    <Image className="w-4 h-4 text-gray-700" />
                                </button>
                            </div>

                            {/* Part Details */}
                            <div className="p-4 space-y-3">
                                <div>
                                    <h3 className="font-semibold text-lg text-gray-900 line-clamp-2">
                                        {part.description}
                                    </h3>
                                    <p className="text-sm text-gray-600 mt-1">
                                        Part #: {part.partNumber}
                                    </p>
                                </div>

                                <div className="flex items-center justify-between">
                                    <div className="flex items-center space-x-1">
                                        <DollarSign className="w-4 h-4 text-gray-500" />
                                        <span className="text-xl font-bold text-gray-900">
                                            ${part.price.toFixed(2)}
                                        </span>
                                        {part.listPrice > part.price && (
                                            <span className="text-sm text-gray-500 line-through">
                                                ${part.listPrice.toFixed(2)}
                                            </span>
                                        )}
                                    </div>
                                    <span className={`text-sm font-medium ${stockStatus.color}`}>
                                        {stockStatus.text}
                                    </span>
                                </div>

                                <div className="pt-2 border-t border-gray-200">
                                    <p className="text-xs text-gray-500">
                                        Model: {part.modelNumber}
                                    </p>
                                    <p className="text-xs text-gray-500">
                                        Section: {part.sectionName}
                                    </p>
                                </div>

                                {part.url && (
                                    <a
                                        href={part.url}
                                        target="_blank"
                                        rel="noopener noreferrer"
                                        className="block w-full text-center bg-blue-600 text-white py-2 px-4 rounded-lg hover:bg-blue-700 transition-colors"
                                    >
                                        View Details
                                    </a>
                                )}
                            </div>
                        </div>
                    );
                })}
            </div>

            {/* No Results */}
            {filteredParts.length === 0 && (
                <div className="text-center py-12">
                    <AlertCircle className="w-12 h-12 text-gray-400 mx-auto mb-4" />
                    <p className="text-gray-600">No parts found matching your search.</p>
                </div>
            )}

            {/* Diagram Modal */}
            {selectedDiagram && (
                <div className="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center z-50 p-4">
                    <div className="bg-white rounded-lg max-w-4xl w-full max-h-[90vh] overflow-hidden">
                        <div className="p-4 border-b border-gray-200 flex justify-between items-center">
                            <div>
                                <h3 className="text-lg font-semibold">{selectedDiagram.sectionName}</h3>
                                <p className="text-sm text-gray-600">Model: {selectedModel}</p>
                            </div>
                            <button
                                onClick={() => {
                                    setSelectedDiagram(null);
                                    setSelectedModel(null);
                                }}
                                className="text-gray-500 hover:text-gray-700"
                            >
                                <svg className="w-6 h-6" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                                    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M6 18L18 6M6 6l12 12" />
                                </svg>
                            </button>
                        </div>
                        <div className="p-4 overflow-auto max-h-[calc(90vh-120px)]">
                            <img
                                src={selectedDiagram.diagramLargeImage}
                                alt={selectedDiagram.sectionName}
                                className="w-full h-auto"
                            />
                        </div>
                    </div>
                </div>
            )}
        </div>
    );
};

export default PartsSearch;
